import React from "react";


const Groups = () => {



    return (
        <div>
            {lg.map((i) => (
            <div key = {i.id} >
                <div>
                    <img src="../images/cake.PNG"/>
                </div>
                <div> {i.name} </div>
            </div>
            ))}
        </div>

    )
}

export default Groups;
